import React, { Component } from "react";

class Counter extends Component {
  state = {
    count: 0,
    imageURL: "https://picsum.photos/200",
  };

  render() {
    return (
      <React.Fragment>
        <img src={this.state.imageURL} alt="" />
        <span>{this.state.count}</span>
        <button>Increment</button>
      </React.Fragment>
    );
  }

  formatCount() {}
}

export default Counter;
